import React from 'react';
import { Button } from '../../globalStyles';
import { IconContext } from 'react-icons/lib';
import me from '../../images/me.jpg';
import {
  AboutSection,
  AboutWrapper,
  AboutHeading,
  AboutContainer,
  AboutCard,
  AboutCardInfo,
  AboutCardImg,
  AboutCardPlan,
  AboutCardFeatures,
  AboutCardFeature
} from './About.elements';

function About() {
  return (
    <IconContext.Provider value={{ color: '#a9b3c1', size: 64 }}>
      <AboutSection>
        <AboutWrapper>
          <AboutHeading>ABOUT</AboutHeading>

          <AboutContainer>

            <AboutCard to='/about'>
              <AboutCardInfo>
                <AboutCardImg img={me} />
                <AboutCardPlan>James Bond</AboutCardPlan>
                <AboutCardFeatures>
                  <AboutCardFeature>The James Bond series focuses on a fictional British Secret Service agent created in 1953 by writer Ian Fleming, who featured him in twelve novels and two short-story collections. The character also known by the code number 007.</AboutCardFeature>
                </AboutCardFeatures>
                <Button primary>More</Button>
              </AboutCardInfo>
            </AboutCard>

            </AboutContainer>

        </AboutWrapper>
      </AboutSection>
    </IconContext.Provider>
  );
}
export default About;
